import { StatusBar } from 'expo-status-bar';
import React, {useEffect} from 'react';
import { StyleSheet, Text, View } from 'react-native';
import {OrderWatcher, OrderWatcherClient} from "./_proto/orderWatcher_pb_service";
import {Request, Response} from "./_proto/orderWatcher_pb";
import {grpc} from "@improbable-eng/grpc-web";
import { ReactNativeTransport } from '@improbable-eng/grpc-web-react-native-transport';

export default function App() {

  const host = "http://localhost:7070";


  useEffect(() => {

    const customer = new Request()
    customer.setId(1)

    // grpc.invoke(OrderWatcher.Subscribe, {
